import React from 'react';
import { AppBar, Toolbar, Typography, Button, IconButton, InputBase, Tooltip } from '@mui/material';
import { ShoppingCart, Favorite, Search, Person } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const Header = () => {
  const navigate = useNavigate();

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1, cursor: 'pointer' }} onClick={() => navigate('/')}>
          Doruk Kitap
        </Typography>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <div style={{ position: 'relative', marginRight: 2 }}>
            <Search />
            <InputBase
              placeholder="Kitap, yazar veya yayınevi ara..."
              sx={{ ml: 1, width: '300px' }}
            />
          </div>
          <Tooltip title="Favorilerim">
            <IconButton color="inherit" onClick={() => navigate('/favorilerim')}>
              <Favorite />
            </IconButton>
          </Tooltip>
          <Tooltip title="Sepetim">
            <IconButton color="inherit" onClick={() => navigate('/sepetim')}>
              <ShoppingCart />
            </IconButton>
          </Tooltip>
          <Tooltip title="Hesabım">
            <IconButton color="inherit" onClick={() => navigate('/hesabim')}>
              <Person />
            </IconButton>
          </Tooltip>
          <Button color="inherit" onClick={() => navigate('/giris')}>Giriş Yap</Button>
          <Button color="inherit" onClick={() => navigate('/kayit')}>Üye Ol</Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
